import React, { useEffect } from 'react';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import './NewsComponent.css';
import banner from '../../img/blogs/001/banner.png';

const News001 = () => {

    useEffect(() => {
        document.title = 'Международный женский день';
      }, []);

    return (
        <div>
            <Header />
            <main className='main-container'>
            {/* 1 секция баннер */}
            <section className='main-banner'>
                <div className='banner'>
                    <div className='banner-title'>
                        <strong>Международный женский день</strong>
                    </div>
                    <div className='banner-subtitle'>
                        <p>Важность семейных ценностей заключается в том, что они определяют культуру и образ жизни семьи. 
                Это набор принципов, которые устанавливают то, что важно и ценно для каждого члена семьи</p>
                    </div>
                </div>
                <div className='banner-img'>
                    <img src={banner} alt='' className='banner-img-img'/>
                </div>
            </section>
            </main>
            <Footer />
        </div>
    );
};

export default News001;
